import { Link } from "react-router-dom";
import MiCuenta from "../MiCuenta/MiCuenta";
import "./NavBar.css";
const NavBar = () => {
  return (
    <>
      <nav className="navbar">
        <div className="contain-navbar">
          <ul className="contain-navbar-nav">
            <li className="contain-navbar-item">
              <Link className="nav-link" to="/sobreNosotros">
                Sobre nosotros
              </Link>
            </li>
            <li className="contain-navbar-item">
              {/* <Link className="nav-link" to="/miCuenta">
                Mi cuenta
              </Link> */}
              <label className="nav-link" for="modal-1">
                Mi cuenta
              </label>
              <MiCuenta />
            </li>
            <li className="nav-item-resalt">
              <Link className="nav-link" to="/agendarCita">
                !Agendar tu citaÂ¡
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
};

export default NavBar;
